import React from "react";

function Modal() {
  return (
    <div className="modalContainer">
      <p>
        My name is Kelsie Szost. I am a full-stack web developer with a
        background in design and digital marketing.
      </p>
      <button className="modalBtn">CLOSE</button>
    </div>
  );
}
